import React, { Component } from "react";
import UserService from "../services/UserService";
import sample1 from "../assets/sample1.png";
import sample2 from "../assets/sample2.png";
import sample3 from "../assets/sample3.png";
import sample4 from "../assets/sample4.png";

export default class HomeComponent extends Component {
  constructor(props) {
    super(props);

    this.state = {
      content: "",
    };
  }

  componentDidMount() {
    UserService.getPublicContent().then(
      (response) => {
        this.setState({
          content: response.data,
        });
      },
      (error) => {
        this.setState({
          content:
            (error.response && error.response.data) ||
            error.message ||
            error.toString(),
        });
      }
    );
  }

  render() {
    return (
      <div className="container">
        <div className=" jumbotron">
          <div className="row justify-content-center">
            <homeh1>WELCOME TO KINDERGARTEN MANAGEMENT SYSTEM</homeh1>
          </div>
          <div className="row" style={{marginTop:"20px"}}>
            <div className="row justify-content-center">
              <div style={{ width: "16rem" }}>
                <div className="align-items-center text-dark">
                  <img
                    src={sample1}
                    className="rounded-circle mx-auto d-block"
                    width="130"
                    height="130"
                    alt=""
                  />
                  <div className="card-body text-center">
                    <p className="card-title">
                      <strong>Rescue more time</strong>
                    </p>
                    <small>
                      Save substantial amount of time with our kindergarten management system
                    </small>
                  </div>
                </div>
              </div>

              <div style={{ width: "16rem", height: "23rem" }}>
                <div className="align-items-center text-dark">
                  <img
                    className=" rounded-circle mx-auto d-block"
                    src={sample2}
                    width="130"
                    height="130"
                    alt=""
                  />
                  <div className="card-body text-center">
                    <p className="card-title">
                      <strong>Better decisions</strong>
                    </p>
                    <small>
                      The analytically driven metric system provides best insights of business
                    </small>
                  </div>
                </div>
              </div>
              <div style={{ width: "16rem", height: "23rem" }}>
                <div className="align-items-center text-dark">
                  <img
                    className=" rounded-circle mx-auto d-block"
                    src={sample3}
                    width="130"
                    height="130"
                    alt=""
                  />
                  <div className="card-body text-center">
                    <p className="card-title">
                      <strong>Timely feedback</strong>
                    </p>
                    <small>
                      Automated mechanism of feedback leads to on-time processes
                    </small>
                  </div>
                </div>
              </div>
              <div style={{ width: "16rem", height: "23rem" }}>
                <div className="align-items-center text-dark">
                  <img
                    className=" rounded-circle mx-auto d-block"
                    src={sample4}
                    width="130"
                    height="130"
                    alt=""
                  />
                  <div className="card-body text-center">
                    <p className="card-title">
                      <strong>User self-service</strong>
                    </p>
                    <small>
                      Let your user service themselves to save more time for registration
                    </small>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
